# Title: Implement Trie (Prefix Tree)
# Link: https://leetcode.com/problems/implement-trie-prefix-tree/

from collections import defaultdict

class Trie:

    def __init__(self):
        self.tree = ['', defaultdict(lambda: None), False]

    def insert(self, word: str) -> None:
        node = self.tree
        for ch in word:
            node_1 = node[1]
            if not node_1[ch]:
                node_1[ch] = [ch, defaultdict(lambda: None), False]
            node = node_1[ch]
        node[2] = True

    def search(self, word: str) -> bool:
        node = self.tree
        for ch in word:
            if ch in node[1]:
                node = node[1][ch]
            else:
                return False
        return node[2]


    def startsWith(self, prefix: str) -> bool:
        node = self.tree
        for ch in prefix:
            if ch in node[1]:
                node = node[1][ch]
            else:
                return False
        return True


